import React from "react";
import { Navigate, Route, Routes } from "react-router-dom";
import BookingPage from "../components/03/BookingPage";
import PhotoPage from "../components/01/PhotoPage";
import SchedulePage from "../components/03/right/SchedulePage";
import ThisWeek from "../components/03/right/ThisWeekPage";
import NextWeek from "../components/03/right/NextWeekPage";
import WholeMouth from "../components/03/right/WholeMouthPage";
import ScheduleDetailPage from "../components/03/right/ScheduleDetailPage";

function Router() {
  return (
    <Routes>
      <Route path="*" element={<Navigate to="/bookings" />} />
      <Route path="/bookings" element={<BookingPage />}>
        <Route path="*" element={<Navigate to="/thisweek" />} />
        <Route path="thisweek" element={<ScheduleDetailPage />}>
          {/* <Route path=":roomId" element={<SchedulePage />} /> */}
        </Route>
        <Route path="nextweek" element={<NextWeek />}>
          {/* <Route path=":roomId" element={<SchedulePage />} /> */}
        </Route>
        <Route path="wholemouth" element={<WholeMouth />}>
          {/* <Route path=":roomId" element={<SchedulePage />} /> */}
        </Route>
      </Route>
    </Routes>
  );
}

export default Router;
